import React from 'react';

import './Footer.css';

const Footer = props => {
  return (
    <footer className="Footer" id="footer">
      <p>Welcome to the footer</p>
      <p>This is where we will put licensing info, etc</p>
    </footer>
  )
};

export default Footer;
